public class SignatureInServerTest extends TestCase {
  /**
   * Create the test case
   *
   * @param testName
   *          name of the test case
   */
  public SignatureInServerTest(String testName) {
    super(testName);
  }

  /**
   * @return the suite of tests being tested
   */
  public static Test suite() {
    return new TestSuite(SignatureInServerTest.class);
  }

  /**
   * Rigourous Test :-)
   */
  public void testApp() {
    assertTrue(true);
  }

  public static void main(String[] args) {

    try {
      
      String pdfsource;
      String pdfdest;
      PublicCertificatePrivateKeyPair pair;
      {
        Properties properties = new Properties();
        properties.load(new FileInputStream("test.properties"));
        pdfsource = properties.getProperty("pdf.source");
        pdfdest = properties.getProperty("pdf.dest");
        String p12file = properties.getProperty("p12.file");
        String p12pwd = properties.getProperty("p12.password");
        FileInputStream fis = new FileInputStream(new File(p12file));
        pair = CertificateUtils.readPKCS12(fis, p12pwd);
        fis.close();
      }

      // PADES SIGN
      {
        String signType = FileInfoSignature.SIGN_TYPE_PADES;
        int signMode = FileInfoSignature.SIGN_MODE_IMPLICIT;
        signFile(pdfsource, pdfdest, pair, signType, signMode);
      }

      // XADES ATACHED
      {
        String signType = FileInfoSignature.SIGN_TYPE_XADES;
        int signMode = FileInfoSignature.SIGN_MODE_IMPLICIT; // Attached
        
        String xadesAttachedDest = "hola.pdf.xades_attached.xml";
        signFile(pdfsource, xadesAttachedDest, pair, signType, signMode);
      }

      // XADES DETACHED
      {
        String signType = FileInfoSignature.SIGN_TYPE_XADES;
        int signMode = FileInfoSignature.SIGN_MODE_EXPLICIT; // Detached
        String xadesAttachedDest = "hola.pdf.xades_detached.xml";
        signFile(pdfsource, xadesAttachedDest, pair, signType, signMode);
      }

      System.out.println("FINAL PROCESS DE FIRMA OK");

    } catch (Exception e) {
      e.printStackTrace();
    }

  }

  public static void signFile(String pdfsource, String pdfdest,
      PublicCertificatePrivateKeyPair pair, String signType, int signMode) throws Exception,
      FileNotFoundException, IOException {
    String languageUI = "ca";
    String filtreCertificats = "";
    String username = "anadal";
    String administrationID = "43096845C";
    
    CommonInfoSignature commonInfoSignature = new CommonInfoSignature(languageUI,
        filtreCertificats, username, administrationID);

    String signID = "999";
    File source = new File(pdfsource);
    String name = source.getName();
    String reason = "TEST SIGN";
    String location = "Palma";
    String signerEmail="anadal@ibit.org";
    
    int signNumber = 1;
    String languageSign = "ca";
    
    String signAlgorithm = FileInfoSignature.SIGN_ALGORITHM_SHA1;
    

    int signaturesTableLocation = FileInfoSignature.SIGNATURESTABLELOCATION_WITHOUT;
    PdfVisibleSignature pdfInfoSignature = null;
    if (FileInfoSignature.SIGN_TYPE_PADES.equals(signType)) {
      signaturesTableLocation = FileInfoSignature.SIGNATURESTABLELOCATION_LASTPAGE;
      PdfRubricRectangle pdfRubricRectangle = new PdfRubricRectangle(106, 650, 555, 710);
      // String firmatPerFormat = "{0}{1,choice,0#|1&lt; - NIF {2}}{4,choice,0#|1&lt; - C\u00E0rrec {5}}{6,choice,0#|1&lt; - Unitat {7}} (Emissor {3})";
      IRubricGenerator rubricGenerator = new IRubricGenerator() {
 
        @Override
        public byte[] genenerateRubricImage(X509Certificate cert, Date data) throws Exception {
          return Base64
              .decode("");
        }
      };
      pdfInfoSignature = new PdfVisibleSignature(pdfRubricRectangle, rubricGenerator);
    }

    

    final ITimeStampGenerator timeStampGenerator = null;
    final boolean userRequiresTimeStamp = (timeStampGenerator != null); 
    
    
    // Valors per defcte
    final SignaturesTableHeader signaturesTableHeader = null;
    final SecureVerificationCodeStampInfo csvStampInfo = null;
    
    final  File previusSignatureDetachedFile = null;
    final  int signOperation = FileInfoSignature.SIGN_OPERATION_SIGN;
    PolicyInfoSignature policyInfoSignature = null;

    final String expedientCode = null;
    final String expedientName= null;
    final String expedientUrl = null;
    final String procedureCode = null;
    final String procedureName = null;

    FileInfoSignature fileInfo = new FileInfoSignature(signID, source, previusSignatureDetachedFile,
        FileInfoSignature.PDF_MIME_TYPE, name, reason, location, signerEmail, signNumber,
        languageSign, signOperation, signType, signAlgorithm, signMode, signaturesTableLocation,
        signaturesTableHeader, pdfInfoSignature, csvStampInfo, userRequiresTimeStamp,
        timeStampGenerator, policyInfoSignature, expedientCode,
          expedientName, expedientUrl, procedureCode, procedureName);

    MiniAppletSignInfo info = MiniAppletUtils.convertLocalSignature(commonInfoSignature,
        fileInfo, null, pair.getPublicCertificate());
    
    byte[] signedData;
    if (FileInfoSignature.SIGN_TYPE_PADES.equals(signType)) {

      MiniAppletInServerPAdESSigner signer = new MiniAppletInServerPAdESSigner(pair.getPrivateKey());
 
      signedData = signer
          .fullSign(info.getDataToSign(), info.getSignAlgorithm(),
              new java.security.cert.Certificate[] { info.getCertificate() },
              info.getProperties());
    } else if (signType == FileInfoSignature.SIGN_TYPE_XADES) {
      MiniAppletInServerXAdESSigner signer = new MiniAppletInServerXAdESSigner();
      
      signedData =  signer.sign(info.getDataToSign(), info.getSignAlgorithm(),
          pair.getPrivateKey(), new java.security.cert.Certificate[] { info.getCertificate() },
          info.getProperties());
      
      
    } else {
        throw new Exception("Sign Type do not supported: " + signType);
    }

    File dest = new File(pdfdest);

    FileOutputStream fos = new FileOutputStream(dest);
    fos.write(signedData);
    fos.flush();
    fos.close();

    System.out.println();
    System.out.println();
    System.out.println(" Guardada Firma a " + dest.getAbsolutePath());
    System.out.println(" Tamany " + signedData);
    System.out.println();
    System.out.println();
  }

}
